import "./App.css";
import { Sidebar } from "./components/Sidebar";
import { Header } from "./components/Header";
import { Calendar } from "./components/Calendar";

function App() {
  return (
    <div className="App text-gray-600">
      <div className="flex">
        <div className="w-1/5">
          <Sidebar />
        </div>
        <main className="w-full px-5">
          <Header />
          <Calendar />
        </main>
      </div>
    </div>
  );
}

export default App;
